import "./AddIncome.css";
const AddIncome = () => {
  const [inc, setinc] = [
    {
      name: "salary",
    },
    {
      name: "bonus",
    },
  ];
  return (
    <div className="AddIncome-container">
      <input type="text" placeholder=" Enter Income" />
      <br />
      <input type="number" placeholder=" Enter Income Amount" required="true" />
      <br />
      <button type="submit">Submit</button>

      <h2>Income Transactions</h2>
      {inc.map((i) => {
        i.name;
      })}
    </div>
  );
};
export default AddIncome;
